import React,{useEffect,useState} from 'react'

const DeleteAPI = () => {

    const[users,setUsers] = useState([])

    const [title,setTitle] = useState("");
    const [] = useState("");

    useEffect(()=>{
        fetch("https://jsonplaceholder.typicode.com/posts").then((result)=>{
            result.json().then((resp)=>{              
                setUsers(resp)
            })
        })
    },[])

    function getList(){
        fetch("https://jsonplaceholder.typicode.com/posts").then((result)=>{
            result.json().then((resp)=>{              
                setUsers(resp)
            })
        })
    }

   function deleteUser(id){
    fetch(`https://jsonplaceholder.typicode.com/posts/${id}`,{
        method:'DELETE'
    }).then((result)=>{
        result.json().then((resp)=>{
            getList();
        })
    })
}


  return (
    <>
        <h1>Get Data with API Call</h1>
        <table border="1">
            <tr>               
                <th>User ID</th>
                <th>Id</th>
                <th>Title</th>                
                <th>Body</th>
                <td>Operation</td>
            </tr>          
            {
                users.map((item,i)=>     

                    <tr key={i}>
                        <td>{item.userId}</td>   
                        <td>{item.id}</td>                     
                        <td>{item.title}</td>
                        <td>{item.body}</td>   
                        <td><button onClick={()=>deleteUser(item.id)}>Delete</button></td>                                                
                    </tr>                  
                )
            }           
        </table>

        <>
            <input type="text" />
            <input type="text" />
            <input type="text" />
            <button>submit</button>
        </>
    </>
  )
}

export default DeleteAPI
